import React, { Component } from 'react';

class MovieList extends Component{
    
    constructor(props) {
        super(props);
       
    }



    componentDidMount() {
        usersApi.getAll().then((data) => {
            organizationApi.getAllOrganizations().then(result => {
                this.setState({ ...this.state, users: data.data, organizations: result.data });
                this.props.getAll(data.data);
            }).catch(error => {
                console.log("Error fetching organizations", error);
            });
        }).catch((error) => {
            console.log("Error fetching users", error);
        });
    }
    render() {
        return (
    <div>DSD </div> 
            )
}
}
export default MovieList;
